import Show from "./show";

const Assignment = () => {
  const [apidata, setData] = useState([]);
  useEffect(() => {
    const fetchApi = async () => {
      const response = await fetch(
        "https://jsonplaceholder.typicode.com/photos"
      );
      const data = await response.json();
      //   console.log(data);
      setData(data);
    };
    fetchApi();
  }, []);

  console.log(apidata);
  return (
    <div>
      <div>Hi</div>
    </div>
  );
};

export default Assignment;
